import React from "react";
import { useState } from "react";
import {BrowserRouter as Router, Route, Routes, Link, useNavigate} from 'react-router-dom'
import Card from './card'
import Signup from "./signup";



const App =()=>{

const navigate = useNavigate()
const [isflip, setisflip] = useState(true)
const navigating=(path)=>{
    setisflip(!isflip)
    navigate(path)
}


    return(
        <Router>
            <Routes>
                <Route path="/Signup" element={<Signup/>}/>
                <Route path="/Signin" element={<Card/>}/>
                <Route path="/" element={<Card/>}/>
            </Routes>
            <nav>
                <Link to='/Signup' onClick={()=>navigating('/Signup')} className={isflip?'flip':''}/>
                <Link to='/Signin' onClick={()=>navigating('/Signin')} className={isflip?'':'flip'}/>
            </nav>
        </Router>
       


    )



}


export default App
